import React from "react";
import { Card as CardBS, Col } from "react-bootstrap";

const Card = () => {
	return (
		<CardBS>
			<CardBS.Body>
                <Col xs={3}></Col>
                <Col xs={9}></Col>
			</CardBS.Body>
		</CardBS>
	);
};

export default Card;
